//     'title':'YouTubeâs live TV streaming service goes live in five US cities for $35 per month',
//     'author':'Greg Kumparak',
//     'sample':'YouTube TV takes a bunch of the more popular U.S. cable channels â ABC, Fox, CBS, NBC, CW, Disney, SyFy, ESPN and 40+ more â and crams them into one app. Itâll cost $35 a month, and youâll be able to stream to six devices simultaneously with each plan, starting with todayâs launch in San Francisco, Los Angeles, New York, Chicago and Philadelphia.',
//     'html':'<div class="article-entry text"><p><img class="aligncenter size-full wp-image-1472960" src="https://tctechcrunch2011.files.wordpress.com/2017/04/gsw.jpg?w=680&amp;h=451" alt="" width="680" height="451" srcset="https://tctechcrunch2011.files.wordpress.com/2017/04/gsw.jpg 680w, https://tctechcrunch2011.files.wordpress.com/2017/04/gsw.jpg?w=150&amp;h=99 150w, https://tctechcrunch2011.files.wordpress.com/2017/04/gsw.jpg?w=300&amp;h=199 300w" sizes="(max-width: 680px) 100vw, 680px"></p><p>Back in <a target="_blank" href="https://techcrunch.com/2017/02/28/youtube-launches-youtube-tv-its-live-tv-streaming-service/">February YouTube announced YouTube TV</a>, a $35 TV streaming service it hopes might kill your cable box. At the time, they didnât say exactly when itâd launch â just that itâd be âsoon.â</p><p>âSoon,â it seems, means today. YouTube is rolling out the service in five major US cities this morning.</p><p><a target="_blank" href="https://tv.youtube.com">YouTube TV</a> takes a bunch of the more popular U.S. cable channels â ABC, Fox, CBS, NBC, CW, Disney, SyFy, ESPN and 40+ more â and crams them into one app. Itâll cost $35 a month, and youâll be able to stream to six devices simultaneously with each plan.</p><p>Alas, working around the existing monolith that is the cable industry takes a whileâ¦ so YouTube TV will roll out in different regions over time, starting with todayâs launch in San Francisco, Los Angeles, New York, Chicago and Philadelphia.</p><hr><p>Google sent me a pre-release build of the YouTube TV app, and I spent a bit of time with it prior to launch. Not enough for a full review, but enough for a few thoughts.</p><p>The app is well-designed and intuitive. Itâs composed of just three tabs: Home, Library and Live. Home is your standard âstuff we think you should watchâ page, Library is where youâll find movies and shows youâve saved (more on that in a second) and Live is a big olâ list of everything currently playing on every channel YouTube TV currently offers up.</p><p><img class="aligncenter size-large wp-image-1472956" src="https://tctechcrunch2011.files.wordpress.com/2017/04/screenshot_20170404-235541.png?w=383&amp;h=680" alt="" width="383" height="680" srcset="https://tctechcrunch2011.files.wordpress.com/2017/04/screenshot_20170404-235541.png?w=383&amp;h=680 383w, https://tctechcrunch2011.files.wordpress.com/2017/04/screenshot_20170404-235541.png?w=766&amp;h=1360 766w, https://tctechcrunch2011.files.wordpress.com/2017/04/screenshot_20170404-235541.png?w=84&amp;h=150 84w, https://tctechcrunch2011.files.wordpress.com/2017/04/screenshot_20170404-235541.png?w=169&amp;h=300 169w" sizes="(max-width: 383px) 100vw, 383px"></p><p>This Live interface is particularly slick; as you scroll, a preview of each channelâs live feed slides into place at the top almost instantly. It feels a lot like flipping channels to see whatâs on the olâ cable box â a concept that, in this age of picking and choosing anything you want to watch on demand, seems to be fading away. As someone who dropped his cable subscription half a decade ago, I forgot how natural it feels to just turn on some channel and let it babble in the background. I also forgot how absolutely horrible daytime TV is.</p><div><div id="adsDivdbfcf60deb" class="native-ad-mobile"></div></div><p>After a few frame-rate hiccups that YouTube was able to patch away, the video quality was quite solid. Even fast-moving sports and action flicks look pretty darn good.</p><p>Donât want to watch TV on your phone or tablet all the time? As youâd expect from a Google-built video app, itâs got Chromecast support â and like everything that has Chromecast, itâs super simple. Tap the Chromecast icon, pick which TV you want the video on and youâre set.</p><p>Thereâs a built-in âunlimited DVRâ feature that lets you tap any show to record any and all future instances of it. Itâs a nice touch for sports or shows that arenât on Hulu/etc. (or those that make Hulu/etc. wait a week after airing) â but beyond those scenarios, if Iâm going to be planning ahead to watch something after itâs live, Iâm probably turning somewhere else for it.</p><p>(One curious bit in an otherwise straightforward design: If you want to browse a specific channelâs shows, you first tap into the search bar. Itâs not the first place I thought to look, but it works.)</p><p>So, should you sign up?</p><p>If youâre one of those people who ditched cable TV&nbsp;long ago for Netflix/Hulu/etc. and havenât looked back, you might not be missing much here.</p><p>If, however, youâre staying tied to your monthly cable bill for the sake of catching things live every once in a while (news/sports/etc.) <em>and</em> YouTube TV is available in your area <em>and</em> itâs got the channels you watch, itâs <a target="_blank" href="https://tv.youtube.com">worth a look</a>. The first month is free, and if you pay for a month beyond that, theyâll throw in a Chromecastâ¦ which, with an MSRP of $35, makes that second month kinda-sorta free too.</p><p>The app should roll out for both iOS and Android today.</p></div>',
