//     'sample':' Dojo Madness, a Berlin-based startup that sells analytics and coaching tools to casual and professional online gamers, has raised $6 million in a new round of financing.',
//     'html': '<div class="article-entry text"><img src="https://tctechcrunch2011.files.wordpress.com/2017/04/14857571158_0014882b8b_o-1.jpg?w=1372" class="" originalw="738" src-orig="https://tctechcrunch2011.files.wordpress.com/2017/04/14857571158_0014882b8b_o-1.jpg?w=738" scale="2"><p><a target="_blank" href="http://dojomadness.com/">Dojo Madness</a>, a Berlin-based startup that sells analytics and coaching tools to casual and professional online gamers, has raised $6 million in a new round of financing.</p><p>Setting aside the on-its-face absurdity that this is actually a thing (I am old and stopped understanding the world about two releases of World of Warcraft ago), e-sports is quickly turning into a business that our current president would characterize as âYUGE.â</p><p>The global audience for e-sports is expected to reach nearly 400 million this year (larger than the population of the U.S.), split between enthusiasts and casual viewers, and is expected to grow by 50 percent over the next three years, <a target="_blank" href="https://newzoo.com/insights/trend-reports/global-esports-market-report-2017-light/">according to data Dojo Madness cited</a> from the research firm Newzoo.</p><p>The latest round of financing for <a target="_blank" href="https://www.crunchbase.com/organization/dojo-madness#/entity">Dojo</a> was led by Raine Ventures, the venture investment arm of the boutique investment banking shop, The Raine Group, and K Cube Ventures, the investment arm of Korean messaging platform Kakao.</p><p>Previous investors March Capital and DN Capital also participated in the funding, which brings the total funds that Dojo has raised to $12.75 million.</p><div><div id="adsDivdbfcf60deb" class="native-ad-mobile"></div></div><p>âMany popular esports titles exhibit a very steep learning curve. DOJOâs products improve the experience and engagement of players in their favorite games, and as such, are equally of great value to publishers. We couldnât be more thrilled to partner with such an experienced and passionate team,â&nbsp;said Blair Ford, a venture partner at Raine Ventures, in a statement.</p><p>Dojo Madness sells&nbsp;automated coaching tools for League of Legends, Overwatch and Dota 2, under the brands <a target="_blank" href="http://lolsumo.com/">LOLSUMO</a>, <a target="_blank" href="http://dotasumo.com/">DOTASUMO</a>&nbsp;and <a target="_blank" href="http://oversumo.com/">OVERSUMO</a>. The company also acquired the coaching marketplace Leaguecoaching.gg to add interactive coaching with live training sessions to more professional gamers.</p><p>If those products arenât compelling enough to warrant the companyâs $12.75 million in funding, consider its data and analytics tools for teams and broadcasters involved in competitions for Global Offensive, League of Legends and Dota 2.</p><p>Dojo Madness was founded in 2014 by e-sports veteran and Esports League founder Jens Hilgers, Markus Fuhrmann, the co-founder of Delivery Hero, and Christian Gruber, a digital marketer who previously <a target="_blank" href="http://spacespike.com/">owned his own agency</a> after a stint at Red Bull Media.</p><small>Featured Image: <a target="_blank" href="https://www.flickr.com/photos/samchurchill/">Sam Churchill</a>/<a target="_blank" href="https://www.flickr.com/">Flickr</a> UNDER A <a target="_blank" href="http://creativecommons.org/licenses/by/2.0/">CC BY 2.0</a> LICENSE</small></div>',
