//     'title':'Amazon will refund millions of unauthorized in-app purchases made by kids',
//     'author':'Sarah Perez',
//     'sample':'Amazon will refund millions of unauthorized in-app purchases kids made on mobile devices, having now dropped its appeal of last yearâs ruling by a federal judge who sided with the Federal Trade Commission in the agencyâs lawsuit against Amazon. The FTCâs original complaint said that Amazon should be liable for millions of dollars it charged customers, because of the wayâ¦',
//     'html':'<div class="article-entry text"><img src="https://tctechcrunch2011.files.wordpress.com/2017/04/scaled-firehd6-kids-edition.jpg?w=1180" class="" originalw="620" src-orig="https://tctechcrunch2011.files.wordpress.com/2017/04/scaled-firehd6-kids-edition.jpg?w=620" scale="2"><p>Amazon <a target="_blank" href="https://www.ftc.gov/news-events/press-releases/2017/04/ftc-amazon-withdraw-appeals-paving-way-consumer-refunds-related">will refund millions of unauthorized in-app purchases kids</a> made on mobile devices, having now dropped its appeal of&nbsp;<a target="_blank" href="https://techcrunch.com/2016/04/27/court-holds-amazon-liable-for-years-of-unauthorized-in-app-purchases-made-by-kids/">last yearâs ruling&nbsp;</a>by a federal judge who sided with the Federal Trade Commission in the agencyâs lawsuit against Amazon. The FTCâs original <a target="_blank" href="https://www.ftc.gov/news-events/press-releases/2014/07/ftc-alleges-amazon-unlawfully-billed-parents-millions-dollars">complaint</a> said that Amazon should be liable for millions of dollars it charged customers, because of the way its Appstore software was designed â that is, it allowed kids to spend unlimited amounts of money in games and other apps without requiring parental consent.</p><p>The&nbsp;FTC had previously settled with both <a target="_blank" href="https://techcrunch.com/2014/01/15/apple-settles-with-ftc-over-app-store-in-app-purchases-to-avoid-distracting-legal-fight/">Apple</a> and <a target="_blank" href="https://www.ftc.gov/news-events/press-releases/2014/12/ftc-approves-final-order-case-about-google-billing-kids-app">Google</a> on similar charges, before turning its sights to Amazon.</p><p>The issue had to do with the way the Amazon Appstoreâs in-app purchasing system worked. The Amazon&nbsp;Appstore is the store that comes preloaded on Amazon mobile devices, like Kindle Fire tablets, for example, though there is a way to load it onto other Android devices, too.</p><p>Of course,&nbsp;many kidsâ game developers notoriously try to blur the lines between whatâs free and paid. They also often design games in a way that they only fully function&nbsp;when kids use&nbsp;in-game items, which can be sometimes earned through gameplay or other times purchased through the app itself. Kids are pushed to buy these things regularly â as any parent can tell you, having experienced their kidsâ begging for these items.</p><p>But in Amazonâs Appstore, which launched back in 2011, the company didnât originally require passwords on in-app purchases. This allowed kids to buy coins and other items to their heartsâ content. One particularly awful example involved a game called âIce Age Villageâ that offered an in-app purchase of $99.99.</p><p>Amazon introduced password-protected in-app purchases in March 2012, but then only on those where the purchase exceeded $20. In early 2013, it updated the system again to require passwords, but also allowed a 15-minute window afterwards where no password was required. The FTC said Amazon didnât obtain âinformed consentâ until July 2014.</p><div><div id="adsDiv88c02c8d53" class="native-ad-mobile"></div></div><p>To make matters worse, parents complaining werenât told how to get a refund and Amazon had even suggested at times that refunds werenât possible, the FTCâs complaint had said.</p><p>Amazon and the FTC have now agreed to end appeals related to the earlier ruling, <a target="_blank" href="https://www.ftc.gov/news-events/press-releases/2014/07/ftc-alleges-amazon-unlawfully-billed-parents-millions-dollars">the FTC announced on Tuesday, April 4.</a> Another issue that had come into play was the FTCâs request for an injunction to forbid Amazon from similar conduct in the future. The court denied that injunction, the FTC appealed, and Amazon cross-appealed the ruling that said Amazon had violated the law.</p><p>Now the two parties have agreed to end their litigation and begin the refund process.</p><p>More than $70 million in in-app charges made between November 2011 and May 2016 may be eligible for refunds, the FTC notes. Itâs not likely that all affected customers will take the time to make their requests, however.</p><p>Amazon has not yet announced how the refund program will operate or when it launches but these details are to come shortly, says the FTC.</p></div>',
