//     'title':'Cendana Capital â which funds 15 top seed-stage groups â just raised a ton of capital',
//     'author':'Connie Loizos',
//     'sample':'Michael Kim is pretty much killing it. Kimâs Cendana Capital just closed on $260 million in fresh capital across a network of five funds. Altogether, the San Francisco-based outfit now manages around $450 million â which says a lot about how much the market has changed. We talked with Kim â who runs Cendana with principal Graham Pingree â about that ongoing evolution.',
//     'html':'<div class="article-entry text"><img src="https://tctechcrunch2011.files.wordpress.com/2017/04/screen-shot-2017-04-05-at-8-04-40-am1.png?w=1372" class="" originalw="738" src-orig="https://tctechcrunch2011.files.wordpress.com/2017/04/screen-shot-2017-04-05-at-8-04-40-am1.png?w=738" scale="2"><p>Michael Kim is&nbsp;pretty much killing it.</p><p>Seven years ago, when he first approached investors with the idea of creating a fund-of-funds that would invest in seed-stage, or so-called micro VC, funds, they were cool to the idea. In fact, it took&nbsp;Kim â formerly a partner with the venture firm Rustic Canyon Ventures&nbsp;â roughly two years to raise the firmâs $28.5 million debut fund.</p><p>Fast-forward, and Kimâs&nbsp;<a target="_blank" href="http://www.cendanacapital.com/">Cendana Capital</a> â&nbsp;which has backed venture firms&nbsp;<a target="_blank" href="http://forerunnerventures.com/">Forerunner Ventures</a>, <a target="_blank" href="http://softtechvc.com/">SoftTech VC</a>, <a target="_blank" href="http://www.iaventures.com/">IA Ventures</a>, <a target="_blank" href="http://firstround.com/">First Round</a>, <a target="_blank" href="http://freestyle.vc/">Freestyle Capital</a>, <a target="_blank" href="http://www.k9ventures.com/">K9 Ventures</a>, <a target="_blank" href="http://www.bowerycap.com/">Bowery Capital</a>&nbsp;and <a target="_blank" href="http://lererhippeau.com/">Lerer Hippeau Ventures</a>, among others &nbsp;â just closed on $260 million in fresh capital across a network of five funds.</p><p>One vehicle is Cendanaâs third and newest fund-of-funds, which works just like that $28.5 million debut fund,&nbsp;except itâs nearly three times as big, with $80 million in commitments.</p><p>Kim also raised $35 million to make direct co-investments; a $60 million co-investment fund that he&nbsp;manages on behalf of&nbsp;The University of Texas Investment Management Company; a $75 million fund called Cendana Blackbird that Cendana&nbsp;manages on behalf of an unnamed pension fund (it invests in Cendanaâs portfolio funds in cases where it can get a greater allocation); and a $10 million, late-stage fund called Cendana Kendall thatâs being managed&nbsp;on behalf of an unnamed family office. (The idea is for Kim to plug the money into&nbsp;one or two breakaway companies in&nbsp;one of his fund managersâ portfolios.)</p><p>Altogether, the San Francisco-based outfit&nbsp;now manages&nbsp;around $450 million â&nbsp;which says&nbsp;a lot about how much the market has changed. We talked yesterday with Kim&nbsp;â&nbsp;who runs Cendana with principal Graham Pingree&nbsp;â about that ongoing evolution.</p><p><strong>TC: Cendana seems to be an investor in every major micro VC fund out there. How many funds are you involved with?</strong></p><p>MK: We have 15 âcoreâ relations, where weâve invested $8 million to $10 million, then we have a pilot program where we invest $1 million in 8 or 9 groups that we like but we have some lingering questions about their strategy. For example,&nbsp;<a target="_blank" href="http://nextviewventures.com/">NextView Ventures</a> in Boston and <a target="_blank" href="http://www.muckercapital.com/">Mucker Capital</a> in L.A. were part of our pilot program because we didnât have a high conviction about either the Boston or L.A. ecosystems. Now we do, so theyâve become core.</p><p>The hardware investment firms <a target="_blank" href="http://bolt.io/">Bolt</a> and <a target="_blank" href="https://www.root.vc/">Root Ventures</a> also became part of that pilot program, because we had questions about whether seed was the right entry point for hardware investing.</p><p><strong>TC: Which is the newest fund to join your pilot portfolio?</strong></p><p>MK: <a target="_blank" href="http://notationcapital.com/">Notation Capital</a> in Brooklyn.</p><p><strong>TC: Do all âpilotsâ become âcoreâ?</strong></p><p>MK: No. And weâve ended up not continuing with some core funds as&nbsp;some have evolved from seed-stage to Series A-stage funds, and backing them is not the mandate our LPs gave us, notwithstanding how amazingly theyâve performed for us. I wonât share publicly which those are, though.</p><p><strong>TC: Where do you draw the line? So many of your&nbsp;managers are now investing two or three times the amount of their debut funds.</strong></p><p>MK: Weâre SoftTechâs biggest LP. And SoftTech could have easily raised a $150 million vehicle (when it was <a target="_blank" href="https://techcrunch.com/2016/06/08/softtech-vc-closes-its-fifth-fund-with-100-million-raises-50-million-opportunity-fund/">last out fundraising</a>). But it realized a seed found should be no larger than $100 million so raised a $100 million seed fund and a separate $50 million opportunity fund. Weâre investors in the $100 million piece&nbsp;alone.</p><p><strong>TC: So as far as youâre concerned, a fund canât do seed well with more than $100 million under management. What about ownership stakes? Do you have a strong feeling about how much a manager should own of each company?&nbsp;</strong></p><p>MK: We look for those who lead deals. We think ownership is paramount. We want our fund managers to focus on at least 15 percent ownership. So with the average seed fund going from $1 million to $3 million in recent years, to lead that round, you need to write a check for $1.5 million. Thatâs why these seed funds have gotten bigger.</p><div><div id="adsDivdbfcf60deb" class="native-ad-mobile"></div></div><p><strong>TC: Do you care how many people are managing money at these seed firms? You see some that have several partners; you have others, like K9 Ventures, thatâs run by a solo general partner, Manu Kumar.</strong></p><p>MK: We look at it as capital per partner. Lerer Hippeau has four people investing $113 million, so thatâs $28 million per partner. We think the ideal range is $25 million to $35 million per partner.</p><p><strong>TC: There are <em>so</em> many seed fund investors. How many groups do you think youâve met with altogether, and do you ever fund firms outside of the U.S.?</strong></p><p>MK: Since inception, weâve&nbsp;talked with around 700 firms, either in person or over the phone.</p><p>We havenât invested internationally. We felt that the ecosystems outside the U.S. were substantially weaker, owing to the lack of available follow-on capital. That was a huge concern in Europe, where for a long time it was basically Accel and Balderton and Index. &nbsp;But now thereâs <a target="_blank" href="http://blueyard.com/">BlueYard Capital</a> in Berlin and <a target="_blank" href="http://www.felixcap.com/">Felix Capital</a>&nbsp;and <a target="_blank" href="http://www.mosaicventures.com/">Mosaic Ventures</a> in London. Thereâs a lot more going on, so we think the&nbsp;ecosystem has gotten better.</p><p><strong>TC: You make direct investments in certain companies when you can. For example, you were able to get equity in Dollar Shave Club through Forerunner Ventures, which also provided an introduction to the company&nbsp;when you asked for one. How do these things come together? How do you choose which companies to pursue with so many startups in your managersâ portfolios?</strong></p><p>MK: We have a monthly call with fund managers, but weâre&nbsp;also&nbsp;always trading calls or IMing because we have a pretty close relationship with them. And&nbsp;if a&nbsp;fund manager talks about a certain company and keeps mentioning it every month and it becomes clear that itâs tracking well, weâll ask for an intro to its management team.</p><p><strong>TC: Does that ever create a conflict for your fund managers?</strong></p><p>MK: We only invest if the fund manager is coming into the same round, and usually they are stretching their reserves to do that; they canât do full pro rata, which creates an opportunity for us to try and get in.</p><p>These are usually very attractive opportunities; weâve had to fight to get into most of these. But I do think the opportunity set is increasing as these companies bubble up to the Series A and B stages.</p><p><strong>TC: Any thoughts on secondary sales and whether seed funds should hang on for the long haul if they have a buzzy company in their portfolio?</strong></p><p>MK: Thereâs definitely an opportunity for managers&nbsp;to sell into these higher-priced rounds. Our advice is if you have a 10x return, consider selling 10 to 20 percent and getting liquidity to investors. And weâve seen a lot more of that over the last 12 to 24 months.</p><p>Seed funds can become hostages in high-valuation companies otherwise. Say the company ends up raising $100 million at a $2 billion valuation. Well, the seed would have been happy to sell, but now the new investor wants 3x from there, so this company has to get to a&nbsp;$6 billion valuation, and a lot of bad things can happen in pursuit of that.</p><p><strong>TC: Do you sell before the big exit? Iâm&nbsp;guessing you donât need to worry about so-called signaling risk â or do you?</strong></p><p>MK: We really donât. We could sell into the next round and no one would blink an eye. Itâs a negative signal if Sequoia does it. If Cendana does it, no one cares.</p></div>',
