//     'sample':'Itâs no secret that Google has developed its own custom chips to accelerate its machine learning algorithms. The company first revealed those chips, called Tensor Processing Units (TPUs), at its I/O developer conference back in May 2016, but it never went into all that many details about them, except for saying that they were optimized around the companyâs own TensorFlowâ¦',
//     'html': '<div class="article-entry text"><img src="https://tctechcrunch2011.files.wordpress.com/2017/04/2017-04-05_1013.png?w=1180" class="" originalw="738" src-orig="https://tctechcrunch2011.files.wordpress.com/2017/04/2017-04-05_1013.png?w=738" scale="2"><p>Itâs <a target="_blank" href="https://techcrunch.com/2016/05/18/google-built-its-own-chips-to-expedite-its-machine-learning-algorithms/">no secret</a> that Google has developed its own custom chips to accelerate its machine learning algorithms. The company first revealed those chips, called Tensor Processing Units (TPUs), at its I/O developer conference back in May 2016, but it never went into all that many details about them, except for saying that they were optimized around the companyâs own <a target="_blank" href="https://www.tensorflow.org/">TensorFlow</a> machine-learning framework. Today, for the first time, itâs sharing <a target="_blank" href="https://drive.google.com/file/d/0Bx4hafXDDq2EMzRNcy1vSUxtcEk/view">more details</a> and <a target="_blank" href="https://cloudplatform.googleblog.com/2017/04/quantifying-the-performance-of-the-TPU-our-first-machine-learning-chip.html">benchmarks</a> about the project.</p><p>If youâre a chip designer, you can find all the <del>gory</del> glorious details of how the TPU works in <a target="_blank" href="https://drive.google.com/file/d/0Bx4hafXDDq2EMzRNcy1vSUxtcEk/view">Googleâs paper</a>. The numbers that matter most here, though, are that based on Googleâs own benchmarks (and itâs worth keeping in mind that this is Google evaluating its own chip), the TPUs are on average 15x to 30x faster in executing Googleâs regular machine learning workloads than a standard GPU/CPU combination (in this case, Intel Haswell processors and Nvidia K80 GPUs). And because power consumption counts in a data center, the TPUs also offer 30x to 80x higher TeraOps/Watt (and&nbsp;with using faster memory in the future, those numbers will probably increase).</p><p><a target="_blank" href="https://tctechcrunch2011.files.wordpress.com/2017/04/2017-04-05_1014.png"><img class="aligncenter size-full wp-image-1473237" src="https://tctechcrunch2011.files.wordpress.com/2017/04/2017-04-05_1014.png?w=986&amp;h=549" alt="" width="986" height="549" srcset="https://tctechcrunch2011.files.wordpress.com/2017/04/2017-04-05_1014.png 986w, https://tctechcrunch2011.files.wordpress.com/2017/04/2017-04-05_1014.png?w=150&amp;h=84 150w, https://tctechcrunch2011.files.wordpress.com/2017/04/2017-04-05_1014.png?w=300&amp;h=167 300w, https://tctechcrunch2011.files.wordpress.com/2017/04/2017-04-05_1014.png?w=768&amp;h=428 768w, https://tctechcrunch2011.files.wordpress.com/2017/04/2017-04-05_1014.png?w=680&amp;h=379 680w" sizes="(max-width: 986px) 100vw, 986px"></a></p><p>Itâs worth noting that these numbers are about using machine learning models in production, by the way â not about creating the model in the first place.</p><p>Google also notes that while most architects optimize their chips for <a target="_blank" href="http://cs231n.github.io/convolutional-networks/">convolutional neural networks</a> (a specific type of neural network thatâs works well for image recognition, for example). Google, however, says, those networks only account for about 5 percent of its own data center workload while the majority of its applications use <a target="_blank" href="https://en.wikipedia.org/wiki/Multilayer_perceptron">multi-layer perceptrons</a>.</p><p>Google says it started looking into how it could use GPUs, FPGAs and custom ASICS (which is&nbsp;essentially what the TPUs are) in its data centers back in 2006. At the time, though, there werenât all that many applications that could really benefit from this special hardware because most of the heavy workloads they required could just&nbsp;make use of the excess hardware that was already available in the data center anyway. âThe conversation changed in 2013 when we projected that DNNs could become so popular that they might double computation demands on our data centers, which would be very expensive to satisfy with conventional CPUs,â the authors of Googleâs paper write. âThus, we started a high-priority project to quickly produce a custom ASIC for inference (and bought off-the-shelf GPUs for training).â The goal here, Googleâs researchers say, âwas to improve cost-performance by 10x over GPUs.â</p><div><div id="adsDiv88c02c8d53" class="native-ad-mobile"></div></div><p>Google isnât likely to&nbsp;make the TPUs available outside of its own cloud, but the company notes that it expects that others will take what it has learned and âbuild successors that will raise the bar even higher.â</p><p><a target="_blank" href="https://tctechcrunch2011.files.wordpress.com/2017/04/2017-04-05_1011.png"><img class="aligncenter size-full wp-image-1473240" src="https://tctechcrunch2011.files.wordpress.com/2017/04/2017-04-05_1011.png?w=1024&amp;h=422" alt="" width="1024" height="422" srcset="https://tctechcrunch2011.files.wordpress.com/2017/04/2017-04-05_1011.png?w=1024&amp;h=422 1024w, https://tctechcrunch2011.files.wordpress.com/2017/04/2017-04-05_1011.png?w=150&amp;h=62 150w, https://tctechcrunch2011.files.wordpress.com/2017/04/2017-04-05_1011.png?w=300&amp;h=124 300w, https://tctechcrunch2011.files.wordpress.com/2017/04/2017-04-05_1011.png?w=768&amp;h=316 768w, https://tctechcrunch2011.files.wordpress.com/2017/04/2017-04-05_1011.png?w=680&amp;h=280 680w, https://tctechcrunch2011.files.wordpress.com/2017/04/2017-04-05_1011.png 1325w" sizes="(max-width: 1024px) 100vw, 1024px"></a></p><p>&nbsp;</p><p>&nbsp;</p></div>',
