//     'title':'Taser rebrands as Axon and offers free body cameras to any police department',
//     'author':'Devin Coldewey',
//     'sample':'Taser is now Axon. The brand has been a household word for years, but the company felt it was time to leave that identity behind and double down on the body camera and digital evidence management side of its business. As part of that move, itâs offering free body cameras and software to any police department that asks. Yes, free as in beer, and yes, any as in any.',
//     'html':'<div class="article-entry text"><img src="https://tctechcrunch2011.files.wordpress.com/2017/04/axon-6.jpg?w=1180" class="" originalw="738" src-orig="https://tctechcrunch2011.files.wordpress.com/2017/04/axon-6.jpg?w=738" scale="2"><p>Taser is now <a target="_blank" href="http://axon.com">Axon</a>. The brand has been a household word for years, but the company felt it was time to leave that identity behind and double down on the body camera and digital evidence management side of its business. As part of that move, itâs <a target="_blank" href="http://axon.com/offer">offering free body cameras</a> and software to any police department that asks. Yes, free as in beer, and yes, any as in any.</p><p>I talked with the companyâs founder, Rick Smith, about this major change and the shifts in policing and technology that prompted it.</p><p>âWe started the company in a garage 23 years ago in an effort to make the bullet obsolete,â he said. âBut the power of the Taser brand is focused on one thing. Now we do all this stuff with cameras. Thereâs nostalgia, there was a lot of internal resistance. But ultimately organizations have to change.â</p><p>The Taser brand will remain for the stun guns we all know, but the parent company will now be Axon, with the ticker symbol AAXN.</p><p>Axon, you may remember, was the division Taser created a few years ago to focus on the wearable camera space; the tech was getting there, and Taser was in the right position to bring it to law enforcement. Itâs been a major success, but considering the benefits of deployment (some obvious, some disputed), uptake hasnât been as fast as pretty much anyone would like. Right now around 20 percent of police have access to body cameras.</p><p>âItâs really just inertia,â Smith said. Regulatory holdups, budget limitations, and just plain skepticism have slowed things down. So Axonâs solution is to just straight-up give the product away. At least, for a limited time.</p><p>The deal is pretty simple: ask and ye shall receive an Axon Body 2 camera for every officer, the software and infrastructure to handle all the footage, and online training in how to use it. Everything is free with no obligations for a year.</p><p><a target="_blank" href="https://tctechcrunch2011.files.wordpress.com/2017/04/taser_axon_body.jpg"><img class="aligncenter size-full wp-image-1472905" src="https://tctechcrunch2011.files.wordpress.com/2017/04/taser_axon_body.jpg?w=1024&amp;h=735" alt="" width="1024" height="735" srcset="https://tctechcrunch2011.files.wordpress.com/2017/04/taser_axon_body.jpg?w=1024&amp;h=735 1024w, https://tctechcrunch2011.files.wordpress.com/2017/04/taser_axon_body.jpg?w=150&amp;h=108 150w, https://tctechcrunch2011.files.wordpress.com/2017/04/taser_axon_body.jpg?w=300&amp;h=215 300w, https://tctechcrunch2011.files.wordpress.com/2017/04/taser_axon_body.jpg?w=768&amp;h=551 768w, https://tctechcrunch2011.files.wordpress.com/2017/04/taser_axon_body.jpg?w=680&amp;h=488 680w, https://tctechcrunch2011.files.wordpress.com/2017/04/taser_axon_body.jpg 2000w" sizes="(max-width: 1024px) 100vw, 1024px"></a>âAt the end of the year, they can return the stuff and never pay us a dime,â Smith said. âWe thought it was win-win.â</p><p>Skeptical they can handle demand? The company has âtens of thousands of cameras on the shelves,â he noted. âWeâve been planning this for a while â we added a lot of support staff last year.â</p><p>Now, it hardly need be mentioned that this isnât being done out of the goodness of Axonâs corporate heart. The company stands to profit immensely by being the de facto default for police camera systems. And itâs worth mentioning that the free offer makes it difficult for departments to resist, and once the benefits are public, itâs going to be even more difficult to give up.</p><p>But while in some situations I would characterize this as a sort of Trojan horse, itâs my opinion (and clearly Smithâs) that body cameras are probably the single most beneficial step we can take today to improve the quality of policing.</p><div><div id="adsDivdbfcf60deb" class="native-ad-mobile"></div></div><p><a target="_blank" href="https://tctechcrunch2011.files.wordpress.com/2017/04/axon-26.jpg"><img class="aligncenter size-full wp-image-1472907" src="https://tctechcrunch2011.files.wordpress.com/2017/04/axon-26.jpg?w=1024&amp;h=720" alt="" width="1024" height="720" srcset="https://tctechcrunch2011.files.wordpress.com/2017/04/axon-26.jpg?w=1024&amp;h=720 1024w, https://tctechcrunch2011.files.wordpress.com/2017/04/axon-26.jpg?w=150&amp;h=105 150w, https://tctechcrunch2011.files.wordpress.com/2017/04/axon-26.jpg?w=300&amp;h=211 300w, https://tctechcrunch2011.files.wordpress.com/2017/04/axon-26.jpg?w=768&amp;h=540 768w, https://tctechcrunch2011.files.wordpress.com/2017/04/axon-26.jpg?w=680&amp;h=478 680w, https://tctechcrunch2011.files.wordpress.com/2017/04/axon-26.jpg 1729w" sizes="(max-width: 1024px) 100vw, 1024px"></a></p><p>Not only do body cameras provide invaluable documentation of every interaction, they save a ton of time and money.</p><p>âCops spend two-thirds of their time as a data entry clerk,â Smith said. âAnd when it comes down to it, no one trusts those reports anyway! We have much better information coming from the camera. It contains everything you would put in the report.â</p><p>âWe believe we can cut that bureaucratic load, and if we can do that, weâll effectively triple the worldâs police force.â</p><p></p><div class="aside aside-related-articles"><h2>Related Articles</h2><a href="https://techcrunch.com/2016/10/03/police-complaints-drop-93-percent-after-deploying-body-cameras/">Police complaints drop 93 percent after deploying body cameras</a><a href="https://techcrunch.com/2016/05/17/study-finds-that-police-body-cameras-may-increase-assaults-if-used-improperly/">Study finds that police body cameras may increase assaults -- if used improperly</a><a href="https://techcrunch.com/2016/07/13/beyond-the-bullet/">Beyond the bullet</a></div>Big talk, but at least heâs putting his money where his mouth is. The program will be costly to Axon at first, but I canât picture it playing out any way but positive in the long run. And in the meantime, a whole lot of police departments are going to get the tech they deserve but that tight budgets meant they werenât going to get for years. If the cost for that is that a single company dominates the field for now, I think thatâs a reasonable trade-off.<p></p><p>Of course, in order to replace reports, Axonâs software has to get a lot more sophisticated. Right now body cameras are sort of backup evidence, while laboriously filled out reports are still the standard. But the plan is to automate the extraction of information from the video to expedite things.</p><p>For example, the system could automatically transcribe any speech in the video and tag events with GPS and other stats. So when the officer wants to check what a person said during a traffic stop, they donât have to scrub through 2 hours of video â they can just search for an interaction, or the license plate. AI systems could also intelligently redact videos, blurring out the faces of bystanders so that the video can be released publicly or presented in court.</p><p>That kind of data digging can get really creepy real fast, and Smith was quick to downplay the idea that Axon would be poring through millions of hours of footage assembling a kind of meta-surveillance database.</p><p>âWeâre forming an AI ethics board with experts from outside the company,â he said. âItâs important weâre building the tech with the right considerations.â</p><p>It should be a big year for the newly renamed company, and letâs hope itâs equally big for the police departments itâs aiming to equip.</p></div>',
