//     'sample':'Itâs actually a pretty great URL: Bus.com. Itâs also a much better brand identity than Sharethebus, which is the old name of the company that just raised a $5 million Series A round from Jackson Square Ventures and BMWâs i Ventures investment arm. Bus.com is the destination youâd expect to head to for what the company does, which is organize charter bus trips forâ¦ ',
//     'html':'<div class="article-entry text"><img src="https://tctechcrunch2011.files.wordpress.com/2017/04/mcgill-students-on-a-bus1.jpg?w=1306" class="" originalw="738" src-orig="https://tctechcrunch2011.files.wordpress.com/2017/04/mcgill-students-on-a-bus1.jpg?w=738" scale="2"><p>Itâs actually a pretty great URL: <a target="_blank" href="http://bus.com">Bus.com</a>. Itâs also a much better brand identity than Sharethebus, which is the old name of the company that just raised a $5 million Series A round from Jackson Square Ventures and BMWâs i Ventures investment arm. Bus.com is the destination youâd expect to head to for what the company does, which is organize charter bus trips for festivals, sporting events and shows by teaming up with bus companies with unused inventory.</p><p>The Bus.com model includes online rental, GPS tracking of buses so passengers know exactly when theyâre arriving, and online ticketing. The founding team, which was a Y Combinator Winter 2016 class graduate, saw an opportunity to update the process of chartering buses for mass transit to one-off events and occasions, including festivals like the Way Home music festival north of Toronto, in Canada, and Sasquatch.</p><p>Perviously, charter bus services for this market, which accounts for around $4 billion in annual revenue according to Bus.com, has relied heavily on a network of small operators with around 10 or fewer buses each. These charter operators had no common standards or platform in terms of pricing, service or booking process, leading to a lot of confusion and complexity on the user end of the process, and also for festival operators.</p><p>Bus.com co-founder Wolf Kohlberg has âonly ever worked in booking, planning and travel execution,â explains his partner and the startupâs CEO&nbsp;Kyle Boulay&nbsp;on a phone call. Kohlberg started and ran a successful bus booking company to provide transit to soccer games in his home country of Germany before moving around and landing in Quebec, where he was working for a travel agency and noticed that a lot of small bus companies had a lot of unused inventory, but were lacking basic organizational tools including things like websites. He teamed up with web developer and designer Boulay to create a tool to take advantage of this opportunity, which was growing thanks to dwindling individual ownership of cars, paired with a tendency for events to be located just outside cities and urban centers.</p><div><div id="adsDiv88c02c8d53" class="native-ad-mobile"></div></div><p>The team created a basic software platform that brought together a lot of the missing elements in one place, and have been iterating on it very since. Their focus is increasingly on making sure festival and event organizers can more easily offer charter travel as an integrated component of what they provide their customers.</p><p>âAll that software is actually very much in need in the charter bus industry, and not just around renting per seat, but renting buses in general, and helping turn event producers into smart travel planners for their attendees and for their guests,â Boulay&nbsp;explained. âThe rebrand from Sharethebus to Bus.com better positions us as a more holistic solution for the industry in general and the population at large.â</p><p>I asked Lastovskiy if he believes an investment from BMW, even if through their venture organization specifically, indicates any larger interest among automakers in the charter space as a mobility service opportunity. He said he couldnât speculate as to the car industryâs interest in that area, but itâs an interesting partner nonetheless given recent explorations into unique transportation models by car companies in general.</p></div>',
