//     'html':'<div class="article-entry text"><img src="https://tctechcrunch2011.files.wordpress.com/2017/04/uber-vs-waymo.png?w=1306" class="" originalw="738" src-orig="https://tctechcrunch2011.files.wordpress.com/2017/04/uber-vs-waymo.png?w=738" scale="2"><p>Uber admitted today that it had found one of the documents Waymo alleges was stolen by a former employee â who left its self-driving car effort to join Uberâs â on the employeeâs personal computer.</p><p>The document was found on a personal device belonging to&nbsp;Sameer Kshirsagar, Uberâs attorney Arturo Gonzalez said at a court hearing today. Itâs the first time that Uber has acknowledged that any of Waymoâs documents are in the possession of any Uber employees. However, Uber emphasized that the document was not found on Uberâs computers. âWe did collect documents from him and thus far we have only found one document from his computers that matches the documents identified in the complaint,â Gonzalez said.</p><p>Waymo claims that Kshirsagar downloaded several confidential documents in June 2016, one month before resigning and joining Anthony Levandowski at Uber. The names of the five specific documents are partially redacted in court filings, but one references âlaser questionsâ and another âlens placement.â</p><p>Levandowski is one of three Uber employees accused of taking Waymo trade secrets, and Waymo says he took 14,000 documents, while Kshirsagar and&nbsp;Radu Raduta took only a few. Waymo is now asking for Uber to turn over those stolen documents as part of the discovery process in its trade secret lawsuit against its competitor, while Uber argues that it cannot&nbsp;hand over anything from Levandowski without violating his Fifth Amendment rights and that it has already thoroughly searched for the documents at Uber.</p><p>Uber said it has interviewed 85 current and former employees, 42 of whom worked in the automotive division. Uber searched 10 of the employeesâ computers and looked through the companyâs git repository for files that matched Waymoâs descriptions. The company found 31,000 hits but described them as ânot substantive.â</p><div><div id="adsDivdbfcf60deb" class="native-ad-mobile"></div></div><p>âI&nbsp;believe that we will demonstrate to you that those 14,000 files never made it to Uber,â Gonzalez said.</p><p>Waymo claimed in a letter to the court that Uber did not meet the deadline to hand over documents and refused to provide all of the documents Waymo had requested, particularly the 14,000 confidential Waymo documents Levandowski allegedly downloaded before he left the company to lead Uberâs self-driving car unit.</p><p>âTo the extent Uber tries to excuse its noncompliance on the grounds that Mr. Levandowski has invoked the Fifth Amendment and refused to provide Uber with documents or assistance, Waymo notes that Mr. Levandowski remains â <em><strong>to this day</strong></em> â an Uber executive and in charge of its self-driving car program. Uber has ratified Mr. Levandowskiâs behavior and is liable for it,â Waymo attorney&nbsp;Charles K. Verhoeven wrote in a letter to the court (emphasis his).</p><p>Judge William Alsup, who is presiding over the case, ordered Uber to search more thoroughly for the documents. He told Uber to search using 15 terms provided by Waymo, first on the employeesâ computers that had already been searched, then on 10 employeesâ computers selected by Waymo, and then on all other servers and devices connected to employees who work on Uberâs LiDAR system.</p><small>Featured Image: Bryce Durbin/TechCrunch</small></div>',
