//     'author':'Darrell Etherington',
//     'sample':'Udacityâs self-driving car program has been focused on training engineers and helping progress the field with open source contributions, but now Udacity Vice President Oliver Cameron is striking out with a new company called Voyage, which was born out of Udacityâs autonomous efforts. Voyage wants to put self-driving cars on the road as part of a fleet of taxis, created usingâ¦',
//     'html':'<div class="article-entry text"><img src="https://tctechcrunch2011.files.wordpress.com/2017/04/voyage-car.jpg?w=1306" class="" originalw="738" src-orig="https://tctechcrunch2011.files.wordpress.com/2017/04/voyage-car.jpg?w=738" scale="2"><p>Udacityâs self-driving car program has been focused on training engineers and helping progress the field with open source contributions, but now Udacity Vice President Oliver Cameron is striking out with a new company called <a target="_blank" href="http://voyage.auto">Voyage</a>, which was born out of Udacityâs autonomous efforts. Voyage wants to put self-driving cars on the road as part of a fleet of taxis, created using retrofits to existing vehicles that add autonomous capabilities without requiring ground-up vehicle creation.</p><p>The task Voyage sets for itself is nonetheless incredibly ambitious: The company wants to operate its own self-driving service entirely, including creating the ride hailing platform through which&nbsp;itâll operate, and providing a unique product that relies heavily on voice input from the driver to get the ride going, control music and make stops, reports<a target="_blank" href="http://www.businessinsider.com/voyage-autonomous-taxi-udacity-2017-4"> Business Insider</a>. Voyage sees its customers as âdriversâ in the sense that theyâre in control of the in-vehicle experience, even if the vehicle is driving itself.</p><p>Voyage wants to get its cars working in a commercial capacity sooner, rather than later. The startup is looking at fielding vehicles âvery soon,â according to the Insider report, and has already secured permission to start operating test vehicles with passenger trials sometime in the next few months, though itâs not discussing specific spots just yet.</p><p>Voyage will enter a busy space with tough competitors, including Uber and Ford, who have a lot of road experience already under their belts. The company also isnât taking any of the tech developed by Udacity students via its self-driving program with it, according to Udacity, and Udacity CEO Sebastian Thrun said that heâs keeping his distance from any of Voyageâs activities because of conflicts related to his prior role at Googleâs self-driving car program.</p><div><div id="adsDiv88c02c8d53" class="native-ad-mobile"></div></div><p>Udacity provided the following statement regarding Voyageâs debut via a spokesperson:</p><p><em>Our Self-Driving Car Nanodegree program has seen strong demand with over 6,600 students enrolled worldwide and 24 hiring partners including Mercedes-Benz, BMW, Nvidia and Delphi among others. We are thrilled to have built a program of this calibre and have the ability to spin off a company in the self-driving space â there is no better testimony for the program. We look forward to watching Voyage grow in this exciting space.</em></p></div>',
